      SELECT ALL - col2 * col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN - ( + 92 ) AND CAST ( NULL AS INTEGER ) + - col2 + - - col1 * - - col2 + - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q12739.out
    data: |
